import warning from '../MenuIcons/alert-circle.svg';
import './deleteComponents.css'

export function DeleteComponent() {


    return (
        <div className={`bg-white deleteMain`}>
            <img src={warning}/>
            <h2>Caution!</h2>
            <p>Are you sure you want to Delete</p>

            <div className={`flex`}>
                <span>Cancel</span>
                <span>Yes</span>

            </div>





        </div>
    );
}
